fileContents:
.socials {
  display: flex;
  flex-direction: row;
  gap: 30px;
}
.nav {
  background-color: #2c2c2c;
}
.nav .button {
  color: white;
}
.suscripcion {
  height: 100%;
  background: #11e6f4;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
.suscripcion .suscripcionImagen {
  background-color: #11e6f4;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 423;
  height: 485;
}
.suscripcion .suscripcionInfo {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 50%;
}
.suscripcion .suscripcionInfo h1 {
  font-style: normal;
  font-weight: bold;
  font-size: 64px;
  line-height: 106.8%;
  text-align: left;
  color: #DFE2EF;
  padding: 0 0 44px;
}
.suscripcion .suscripcionInfo h2 {
  font-size: 2.5 rem;
  font: "Poppins";
  color: #ffffff;
  font-weight: bold;
}
.suscripcion .suscripcionInfo h4 {
  color: #white;
}
.suscripcion .suscripcionInfo h6 {
  font: "Roboto";
}
.suscripcion .suscripcionInfo p {
  font-style: normal;
  font-weight: normal;
  font-size: 17px;
  line-height: 132.4%;
  text-align: left;
  color: white;
  width: 570px;
  padding: 0 0 68px;
}
.suscripcion .suscripcionInfo .suscripcionField {
  display: flex;
  flex-direction: row;
  gap: 30px;
  padding: 0 0 125px;
  color: white;
}
.suscripcion .suscripcionInfo .suscripcionField button {
  width: 175px;
  background: #2c2c2c;
  border-radius: 5px;
  font-style: normal;
  font-weight: normal;
  font-size: 17px;
  line-height: 132.4%;
  text-align: center;
  text-transform: none;
  color: white;
}
.nosotros .nav {
  background-color: #2c2c2c;
}
.nosotros .nav .button {
  color: white;
}
.nosotros {
  height: 100%;
  background: #11e6f4;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding-top: 100px;
  padding-left: 25px;
  text-align: justify;
}
.nosotros h2 {
  font: "Roboto";
  padding-right: 50px;
  text-align: center;
}
.nosotros h6 {
  font: "Roboto";
  padding-right: 50px;
}
.nosotros .nosotrosimagen {
  background-color: white;
  display: flex;
  justify-content: center;
  align-items: baseline;
  margin-right: 20px;
}
.nosotros .farmacias .logos .imagen {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  float: left;
  margin: 3px;
  padding: 3px;
  border: black 2px solid;
  border-radius: 15px;
}
